import * as React from "react";
import { createStackNavigator } from "@react-navigation/Stack";
import { NavigationContainer } from "@react-navigation/native";
import Login from "./src/screens/Login";
import Huwaari from "./src/screens/Huwaari"
import Dun from "./src/screens/Dun"
import { createDrawerNavigator } from "@react-navigation/Drawer";
import Home from "./src/screens/Home";

const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();

const DrawerScreen = () => {
  return (
    <Drawer.Navigator useLegacyImplementation initialRouteName="Home">
      <Drawer.Screen name="Home" component={Home} />
      <Drawer.Screen name="Хичээлийн хуваарь" component={Huwaari} />
      <Drawer.Screen name="Оюутны дүн" component={Dun} />
    </Drawer.Navigator>
  );
};

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen
          name="Home"
          options={{ headerShown: false }}
          component={DrawerScreen}
        />
        <Stack.Screen name="оюутны дүн" component={Dun} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
